import React, { useState } from 'react';
import { Menu } from 'antd';

const MyMenu = ({ models, currentModel, setModel }) => {
  const [menuOpen, setMenuOpen] = useState(false);
  const filterKeywords = ['llama3', 'qwen2']; // 示例过滤关键词

  const handleMenuClick = (e) => {
    setModel(e.key);
    setMenuOpen(false); // Close menu after selection
  };

  const items = models
    .filter((model) => filterKeywords.some((keyword) => model.name.includes(keyword)))
    .map((model) => ({
      key: model.name,
      label: model.name,
    }));

  return (
    <div style={{ position: 'relative' }}>
      <Menu
        onClick={handleMenuClick}
        style={{ width: '50%' }}
        mode="inline"
        items={[{ key: 'select-model', label: `当前模型: ${currentModel}`, children: items }]}
        onOpenChange={(openKeys) => setMenuOpen(openKeys.length > 0)}
      />
      {menuOpen && (
        <div style={{ position: 'absolute', top: '100%', left: 0, width: '100%', zIndex: 1 }}>
          <Menu
            onClick={handleMenuClick}
            style={{ width: '100%' }}
            mode="vertical"
            items={items}
          />
        </div>
      )}
    </div>
  );
};

export default MyMenu;
